// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

import "./MyERC20.sol";
import "./dependencies/VRFConsumerBase.sol";

contract TestgroundGame is VRFConsumerBase {
  // Chainlink internal setup
  bytes32 internal keyHash;
  uint256 internal fee;

  // Random handlers

  mapping(address => string) public player_state;
  mapping(bytes32 => address) public player;
  mapping(bytes32 => string[]) public attacker_characters;
  mapping(bytes32 => string[]) public attacked_characters;
  mapping(bytes32 => uint256[]) public damage_dealt;

  constructor()
  public
  VRFConsumerBase(
    0x8C7382F9D8f56b33781fE506E897a4F1e2d17255 /* VRF Coordinator */,
    0x326C977E6efc84E512bB9C30f76E30c160eD06FB /* Link Mumbai Token Contract */)
  {
    keyHash = 0x6e75b569a01ef56d18cab6a8e71e6600d6ce853834d4a5748b720d06f878b3a4;
    fee = 0.0001 * 10 ** 18;
  }

  function roll(uint256 userProvidedSeed) public returns (bytes32 _requestId) {
    require(LINK.balanceOf(address(this)) > fee, "Not enough LINK - fill contract with faucet");
    bytes32 requestId = requestRandomness(keyHash, fee, userProvidedSeed);
    player[requestId] = msg.sender;
    player_state[msg.sender] = "wating for oracle";
    return requestId;
  }

  function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
    attacker_characters[requestId].push("wizard");
    attacked_characters[requestId].push("dragon");
    damage_dealt[requestId].push(150);

    attacker_characters[requestId].push("dragon");
    attacked_characters[requestId].push("warrior");
    damage_dealt[requestId].push(250);

    attacker_characters[requestId].push("priest");
    attacked_characters[requestId].push("dragon");
    damage_dealt[requestId].push(250);

    attacker_characters[requestId].push("dragon");
    attacked_characters[requestId].push("priest");
    damage_dealt[requestId].push(250);

    player_state[msg.sender] = "match generated";
    /*
    if(randomness%6==5)
    {
      testground_token.transferFrom(address(this), requestIdToMsgSender[requestId], win_prize);
    }
    */
  }
}
